import React from 'react';
import {BrowserRouter as Router, Route} from 'react-router-dom'

const Menu = function () {

    return ( 
      <Router>
    <div className = "wrapper__menu close"> 
      <div className="menu">
        <div className="left"></div>
        <div className="right"></div>
        <ul>
            <li >Accueil</li>
            <li>Projets</li>
            <li>Contact</li>
        </ul>
      </div>
    </div>
      </Router>
    )
}

export default Menu;
